import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Grid, Card, Paper, ButtonBase } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    margin: 'auto',
    maxWidth: 400,
  },
  image: {
    width: 128,
    height: 128,
  },
  img: {
    margin: 'auto',
    display: 'block',
    maxWidth: '100%',
    maxHeight: '100%',
  },
}));

const AttentionCard = () => {
  const classes = useStyles();
  const disability = "Diabetes";

  return (
    <div className={classes.root}>
      <Paper className={classes.paper}>
        <Grid container spacing={2}>
          <Grid item xs={12} sm container>
            <Grid item xs container direction="column" justify="flex-start" spacing={2}>
              <Grid item xs>
                <Typography gutterBottom variant="subtitle1">
                  First and last name
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  Treatment recommendation
                </Typography>
              </Grid>
            </Grid>
            <Grid item>
              <Typography variant="subtitle1">Disability</Typography>
            </Grid>
          </Grid>
        </Grid>
      </Paper>
    </div>
  );
}


